import './App.css';
import NavBar from './components/NavBar';
import LoadingBar from 'react-top-loading-bar'
import React, { Component } from 'react'
import News from './components/News';
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <>
        <Router>
          <div>
            <div>
              <LoadingBar
                color='#f11946'
                progress={50}
              /></div>
            <NavBar />
            <h2>Top News</h2>
            <Routes>

              <Route path="/Business" element={<News key="1" cat='business' country='in' />} />
              <Route path="/Entertainment" element={<News key="2" cat='entertainment' country='in' />} />
              <Route path="/" element={<News key="3" cat='general' country='in' />} />
              <Route path="/General" element={<News key="4" cat='general' country='in' />} />
              <Route path="/Health" element={<News key="5" cat='health' country='in' />} />
              <Route path="/Sports" element={<News key="6" cat='sports' country='in' />} />
              <Route path="/Science" element={<News key="7" cat='science' country='in' />} />
              <Route path="/Technology" element={<News key="8" cat='technology' country='in' />} />
            </Routes>
          </div>
        </Router>
      </>
    )
  }
}
